sub descToIdMT($)
{
  my $desc = uc unac_string("UTF8", $_[0]);
  if (exists $descriptorNameToId{$desc}) { return $idDescriptorToIdMT{ $descriptorNameToId{$desc} };}
  else { return -1; }
}

#
# recibe un hash con (texto descriptor => frecuencia) y un número (corte), y devuelve un hash con (texto microtesauro => frecuencia)
# con los "corte" microtesauros más frecuentes
sub tag_cloud($$)
{
  my $corte = exists $_[1] ? $_[1] : 0;
  my %tag_cloud_id = ();
  
  while ( my ($texto, $freq) = each( %{$_[0]} ) ) 
  {
    $tag_cloud_id{ &descToIdMT($texto) } = $freq;
  }
  
  my $i = 0;
  my %tag_cloud = ();
  
  foreach my $id (sort {$tag_cloud_id {$b} cmp $tag_cloud_id {$a}} keys %tag_cloud_id )
  {
    ++$i;
    $tag_cloud { $idMTtoName{$id} } = $tag_cloud_id{$id};
    last if ($i == $corte);
  }
  return %tag_cloud;
}

use File::Slurp qw(read_file);

my $file_name = shift || die "Uso: $0 <nombre de fichero.csv>\n";

my @contenido = read_file( $file_name );

my %prueba;
for my $f (@contenido) {
  chomp($f);
  my ( $descriptor, $veces ) = split( /\t/, $f );
  $prueba{$descriptor} = $veces;
}

